import React from "react";
import Header from "./components/Header";
import Item from "./components/Items"
import Footer from "./components/Footer";

class App extends React.Component {
constructor(props) {
  super(props)
  this.state = {
    items: [
      {
        id: 1,
        title: '123',
        img: '',
        desc: 'Description 1',
        category: '',
        price: '99,99'
      },
      {
        id: 2,
        title: '123',
        img: '',
        desc: 'Description 2',
        category: '',
        price: '199,99'
      },
      {
        id: 3,
        title: '123',
        img: '',
        desc: 'Description 3',
        category: '',
        price: '299,99'
      },
      {
        id: 4,
        title: '123',
        img: '',
        desc: 'Description 4',
        category: '',
        price: '399,99'
      },
    ]
  }
}
render() {
  return (
    <div className="wrapper">
      <Header />
      <Items items = {this.state.items}/>
      <Footer />
    </div>
  );
}};

export default App;
